import Component from '@ember/component';

const FONT_SIZE = 5;
const LINE_HEIGHT = 6.25;
const PADDING_X = 15;
const MAX_CHAR_SIZE = 120;

export default Component.extend({
    DS: Ember.inject.service('store'),
    treatmentBackend:[],
    
    steps: Ember.computed('clientName', 'clientTreat', 'case', 'outcome', function(){
        var linecounter = 2;
        var currCase;
        if(this.get('case')==undefined || this.get('case')==null){
            currCase = " "; 
        }else{
            currCase = this.get('case'); 
        }

        var treatmentData= [{setFontSize: FONT_SIZE*2, setLineWidth: LINE_HEIGHT}];
        //PDF Image
        var imgData = 'data:image/png;base64,'
        treatmentData.addObject({setTextColor: [0,0,0]} );
        treatmentData.addObject({addImage: [imgData, 'JPEG', 83, 17, 48,  22]} );
        linecounter = linecounter + 6;
        
        //PDF Client Info
        treatmentData.addObject({setTextColor: [9, 45, 247]} );
        treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, "Client Personal Information" ]} );
        linecounter = linecounter + 2 ;
        
        treatmentData.addObject({setTextColor: [0,0,0]} );
        if(this.get('clientName') != null || this.get('clientFamilyName') != null ){
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, this.get('clientName') +" " + this.get('clientFamilyName') ]} );
            linecounter ++;
        }
        if(this.get('clientEmail') != null){
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, this.get('clientEmail') ]} );
            linecounter ++;
        }
        if(this.get('clientPhoneNo') != null){
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, this.get('clientPhoneNo')  ]} );
            linecounter = linecounter + 2 ;
        }
        
        //PDF Exercise List
        treatmentData.addObject({setTextColor: [9, 45, 247]} );
        treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, "Exercise List" ]} );
        linecounter = linecounter + 2 ;
        
        treatmentData.addObject({setTextColor: [0,0,0]} );
        for(var i =0; this.get('clientTreat').length ; i++){
            if(this.get('clientTreat')[i] == undefined){
                  break;
            } 
            var curr = this.get('clientTreat')[i];
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, curr ]} );
            linecounter ++;
            
            if (linecounter %45 == 0){
                treatmentData.addObject({addPage:'100%' });
                linecounter=5;
            }  
              
        }
        linecounter++ ;
        
        //PDF Case
        if(currCase != null || currCase != undefined){
            treatmentData.addObject({setTextColor: [9, 45, 247]} );
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, "Diagnosed Case" ]} );
            linecounter = linecounter + 2 ;
            
            treatmentData.addObject({setTextColor: [0,0,0]} );
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, currCase ]} );
            linecounter = linecounter + 2 ;
        }
        
        //PDF Final Outcome
        var currOut;
        if(this.get('outcome')==undefined || this.get('outcome')==null){
            currOut = " "; 
        }else{
            treatmentData.addObject({setTextColor: [9, 45, 247]} );
            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, "Examination Findings" ]} );
            linecounter = linecounter + 2 ;
            
            treatmentData.addObject({setTextColor: [0,0,0]} );
            var tmpOut = this.get('outcome'); 
            var words= tmpOut.split(' ');
            //console.log(words)
            
            var counter = words.length;
            var currentCount =0;
            var currLine = "";
            while (currentCount < counter){
                
                if(words[currentCount].indexOf("\n") > -1 ){
                    var tmpStr= words[currentCount].split('\n');
                    for( var l = 0; l < tmpStr.length; l++ ){
                        var temp = currLine.length + tmpStr[l].length;
                        if( tmpStr[l] == "" ){
                            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, currLine ]} );
                            linecounter = linecounter +2;
                            currLine =""
                        }else if( temp >= 113 || temp+1 >= 113 ){
                            treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, currLine ]} );
                            linecounter++;
                            currLine =""
                            currLine = tmpStr[l];
                        }else{
                            if(currLine == ""){
                                currLine = tmpStr[l];
                            }else{
                                currLine = currLine +" "+ tmpStr[l];
                            }
                        }
                    }
                    
                }else{
                    var temp = currLine.length + words[currentCount].length;
                    
                    if( temp >= 113 || temp+1 >= 113 ){
                        treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, currLine ]} );
                        linecounter++;
                        currLine =""
                        currLine = words[currentCount];
                    }
                    else{
                        currLine = currLine +" "+ words[currentCount];
                    }
                }
                
                currentCount++;
                if (linecounter %45 == 0){
                    treatmentData.addObject({addPage:'100%' });
                    linecounter=5;
                }
            } 
            
            if(currLine != ""){
                treatmentData.addObject({text: [PADDING_X, LINE_HEIGHT*linecounter, currLine ]} );
                linecounter++;
            }
            
        }
        this.set('treatmentBackend', treatmentData);
        console.log(this.get('treatmentBackend'));
        return treatmentData;
    }),
    
    
    actions:{
        saveToBackend: function(){
            //save client, report type, date, phsio, and pdf info
            var cliID = this.get('currID');
            //console.log(cliID);
            var currCli = this.get('DS').peekRecord('client', cliID);
            //console.log(currCli);
            var newPdf = this.get('DS').createRecord('final-report', {
                        reportName: "Summary Report",
                        pdfArray: this.get('treatmentBackend'),
                        date: new Date(),
                        client: currCli,
                        summary: true
                    });
                    
                    var currentExercise;
                    newPdf.save().then(response =>{
                      this.get('onConfirm')();
                    
                    });
            
        }
        
        
        
    }
});
